  //   fetch('http://localhost:8080')
  //       .then(res => res.json())
  //       .then(data =>
  //           setMembers(data)
  //         )
  // }, []);

  //getter & setter
  const value = {
    userData,
    setUserData,
    members,
    setMembers
  };

  return (
    <>
      <Router>
        <AppContext.Provider value={value}>
          <Routes>
            <Route exact path="/" element={<LoginPage />} />
            <Route exact path="/member" element={<UserLanding />} />
            <Route exact path="/test" element={<Dropdown />} />
          </Routes>
        </AppContext.Provider>
      </Router>
    </>
  );
}

export default App;
